# here we can use the data from the "sign.input" file to verify if our program works
# supplied 11 test vectors since memory is limited
import binascii
import edupy as Ed25519
import time


# shifts the byte at index <pos> by <change> amount i.e. increases its value
def munge_string(s, pos, change):
    return (s[:pos] + int.to_bytes(s[pos] ^ change, 1, "little") +
            s[pos + 1:])


def run(iter):
    start = time.ticks_ms()
    vectors = [
        "b0d0abdd8444e10f293754ac9f16e31bdcdd97b7067128aae8e4d7f11289e2cd1c78cc01bea15352b63c5697f1cfe12ffdd16ddc1d59e77951b6e9408ee228ad:1c78cc01bea15352b63c5697f1cfe12ffdd16ddc1d59e77951b6e9408ee228ad:::",
        "498497fdcc6a105891e023ff32d75f7c3748d8c52d87dd3b2775aefd8160a1432d79ae9cee4ac6275b05749c438ebe552b413d873cc07f14f5fa130177214c54:2d79ae9cee4ac6275b05749c438ebe552b413d873cc07f14f5fa130177214c54:::",
        "d962a6719e5cc7724ca4a1d559536812b4e22aa7bcb13e4fb1722d28e045217ca944592dbc7d77039d720256c3fd340d34db892ab13e4812d662e2840c28b6d0:a944592dbc7d77039d720256c3fd340d34db892ab13e4812d662e2840c28b6d0:::",
        "e1d1416518921d07c8c39e2973d8ea1249caa8bf659cc36c7937f84ece7ad4fc48bdcc3f1a5b8058ed9a32ef1cc48cf7a8ab76a6e4519e5a82855241ad6fff8a:48bdcc3f1a5b8058ed9a32ef1cc48cf7a8ab76a6e4519e5a82855241ad6fff8a:::",
        "2bf74f004d7d0af73a83ea208cc206723d188f4cf607bcad4b6980268ff21fa78fdcd99352438beb52f0d1742bae71844512dd0685aaf1c909e38fc4b5aab6cc:8fdcd99352438beb52f0d1742bae71844512dd0685aaf1c909e38fc4b5aab6cc:::",
        "f5f7d5b73c5a65301b5b4c6710ed12c16e7903177db792ca715e23389d05d83e7c4762e979f0c7e207be1843e2666aca27ea89bff5b61d573c985fc7025e1e28:7c4762e979f0c7e207be1843e2666aca27ea89bff5b61d573c985fc7025e1e28:::",
        "43d4be6de9cb00898e99ddcc2e1530110fa2cbc4376c485e9ca57fd65586d8a33632ad389be2fab3fba0d804bf6345cd322eddd6a75d8c37fd4b5ba1c9c25e8f:3632ad389be2fab3fba0d804bf6345cd322eddd6a75d8c37fd4b5ba1c9c25e8f:::",
        "7d010d760f24e5a2de34089c9fdb19c33b155b0a37ca455a5e5b1dae7a0731764c877b3c4971fbb551166e214d1c7624c52277903c59a562a80b91a85483fb47:4c877b3c4971fbb551166e214d1c7624c52277903c59a562a80b91a85483fb47:::",
        "aaaabb7ce4fffe4dc35747baea2bc5f050bef06ee0c1fd632a067fece1ef4fb5820a2442d5f45f3c791478e098fb3b068da52ec4e8dadec85065c35659f437e0:820a2442d5f45f3c791478e098fb3b068da52ec4e8dadec85065c35659f437e0:::",
        "e95cc2a4d1193b7539fcbbeaaeed985b6fb902dd0efbd6387457550d0d6a2fea72a1ff1e9bb11c8d88968a7b169637adee438e2263f006dca4fe02fe066cbad3:72a1ff1e9bb11c8d88968a7b169637adee438e2263f006dca4fe02fe066cbad3:::",
        "77ad0f942c37f0313e6b0456dabaec81b2d61f6c118ddb29eaf3ac5bf19504d4692d2da5a95f48611a6da89cfb3b3540f6aa0c850d6d98deea870e397fede328:692d2da5a95f48611a6da89cfb3b3540f6aa0c850d6d98deea870e397fede328:::"
    ]

    fails = 0
    successes = 0
    print(f"start loop, vectors init done in {time.ticks_diff(time.ticks_ms(), start)} ms")
    for i in range(iter):
        t1 = time.ticks_ms()
        fields = vectors[i].split(":")
        secret = (binascii.unhexlify(fields[0]))[:32]
        public = binascii.unhexlify(fields[1])
        msg = binascii.unhexlify(fields[2])
        signature = binascii.unhexlify(fields[3])[:64]
        privkey, pubkey = Ed25519.keygen(secret)
        t2 = time.ticks_ms()
        print(f"keygen done in {time.ticks_diff(t2, t1)} ms")
        # assert public == pubkey and signature != Ed25519.sign(...) and Ed25519.verify(public, msg, signature) == False
        if (public != bytes(pubkey)) or (signature != Ed25519.sign(privkey, pubkey, msg)) or \
                (not Ed25519.verify(public, msg, signature)):
            fails += 1
            continue
        t3 = time.ticks_ms()
        print(f"pubkey, privkey and sig check done in {time.ticks_diff(t3, t2)} ms")
        if len(msg) == 0:
            bad_msg = b"x"
        else:
            bad_msg = munge_string(msg, len(msg) // 3, 4)
        # verify changed messages
        if Ed25519.verify(public, bad_msg, signature) or Ed25519.verify(public, msg, munge_string(signature, 20, 8)) or \
                Ed25519.verify(public, msg, munge_string(signature, 40, 16)):
            fails += 1
            continue
        t4 = time.ticks_ms()
        print(f"verify test done in {time.ticks_diff(t4, t3)} ms")
        successes += 1
    print("%d successes and %d fails" % (successes, fails))
    return successes, fails
